/* font preloader script */
"fonts" in document && "{WEB_FONTS}".forEach(o => new FontFace(o.fontFamily, o.src, o.properties).load().then(o => {
    document.fonts.add(o), console.info(`critical font loaded in ${(performance.now() / 1e3).toFixed(3)}s`, {
        font: o
    });
}));